const  Biovalid  = require('./biovalid.module.js').module


let imagem = ""
const biovalid = (new Biovalid())
                        .Auth("","")
let key =  biovalid.PFkey("10716274906") //TODO VALIDATE
let document = biovalid.PFDocumentAnswer(1,"103907861","IIFPR","PR") //TODO VALIDATE
let answerDOC = biovalid.PFAnswer("Matheus de Camargo Marques",document,imagem)

const http = require("http")
//make a simple http server
let server = http.createServer(function (req, res) {
    biovalid
        .PFFaceInput()
        .Init(key,answerDOC)
        .Send()
        .then(json => {
            res.writeHead(200, {"Content-Type": "text/plain"})
            // JSON STRINGFY
            
            res.end(JSON.stringify(json))
        }
        )
        .catch(err =>{ //console.log(err)
             res.writeHead(200, {"Content-Type": "text/plain"})
             res.end("Falhou\n")
        })
    
})

//listen on port 8080
server.listen(8080)
